        private static ImmutableDictionary<JsonEncodedText, Func<XMValue, ValidationContext, ValidationLevel, ValidationContext>> CreateLocalPropertyValidators()
        {
            ImmutableDictionary<JsonEncodedText, Func<XMValue, ValidationContext, ValidationLevel, ValidationContext>>.Builder builder =
                ImmutableDictionary.CreateBuilder<JsonEncodedText, Func<XMValue, ValidationContext, ValidationLevel, ValidationContext>>();

                    builder.Add(
                NameJsonPropertyName,
                (that, validationContext, level) =>
                {
                    JsonString property = that.Name;
                    return property.Validate(validationContext, level);
                });
                    builder.Add(
                NamespaceJsonPropertyName,
                (that, validationContext, level) =>
                {
                    JsonUri property = that.Namespace;
                    return property.Validate(validationContext, level);
                });
                    builder.Add(
                PrefixJsonPropertyName,
                (that, validationContext, level) =>
                {
                    JsonString property = that.Prefix;
                    return property.Validate(validationContext, level);
                });
                    builder.Add(
                AttributeJsonPropertyName,
                (that, validationContext, level) =>
                {
                    AttributeValue property = that.Attribute;
                    return property.Validate(validationContext, level);
                });
                    builder.Add(
                WrappedJsonPropertyName,
                (that, validationContext, level) =>
                {
                    WrappedValue property = that.Wrapped;
                    return property.Validate(validationContext, level);
                });
        
            return builder.ToImmutable();
        }

    
    
    
            private ValidationContext ValidateObject(JsonValueKind valueKind, in ValidationContext validationContext, ValidationLevel level)
        {
            ValidationContext result = validationContext;

            if (valueKind != JsonValueKind.Object)
            {
                return result;
            }

        
        
        
            foreach (Property property in this.EnumerateObject())
            {
                JsonEncodedText propertyName = property.NameAsJsonEncodedText;

        
                        if (__MenesLocalProperties.TryGetValue(propertyName, out Func<XMValue, ValidationContext, ValidationLevel, ValidationContext>? propertyValidator))
                {
                    result = result.WithLocalProperty(propertyName);
                    result = propertyValidator(this, result, level);
                    if (level == ValidationLevel.Flag && !result.IsValid)
                    {
                        return result;
                    }

            
                }
        
        
                        string propertyNameAsString = property.Name;

            
                            foreach (KeyValuePair<Regex, Func<Property, ValidationContext, ValidationLevel, ValidationContext>> patternProperty in __MenesPatternProperties)
                {
                    if (patternProperty.Key.IsMatch(propertyNameAsString))
                    {
                        result = result.WithLocalProperty(propertyName);
                        result = patternProperty.Value(property, result, level);
                        if (level == ValidationLevel.Flag && !result.IsValid)
                        {
                            return result;
                        }
                    }
                }

                    
        
        
                
                if (!result.HasEvaluatedLocalProperty(propertyName))
                {
                    if (level >= ValidationLevel.Detailed)
                    {
                        result = result.WithResult(isValid: false, $"9.3.2.3. additionalProperties - additional property \"{propertyName}\" is not permitted.");
                    }
                    else if (level >= ValidationLevel.Basic)
                    {
                        result = result.WithResult(isValid: false, "9.3.2.3. additionalProperties - additional properties are not permitted.");
                    }
                    else
                    {
                        return result.WithResult(isValid: false);
                    }
                }

        
                    }

        
        
        
            return result;
        }

    
            

            

            

            

    
    
    
            
        private ValidationContext ValidateType(JsonValueKind valueKind, in ValidationContext validationContext, ValidationLevel level)
        {
            ValidationContext result = validationContext;
            bool isValid = false;

        
                
            ValidationContext localResultObject = Menes.Json.Validate.TypeObject(valueKind, result, level);
            if (level == ValidationLevel.Flag && localResultObject.IsValid)
            {
                return validationContext;
            }

            if (localResultObject.IsValid)
            {
                isValid = true;
            }

        
        
        
        
        
        
            result = result.MergeResults(
                isValid,
                level
        
                
                , localResultObject
        
        
        
        
                        );

            return result;
        }

    
    
    
    
